import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/LandingPage.css'; // Make sure this path is correct

// Import the logo image (preferred method if using Create React App or similar)
// If using this, change src={logoSrc} below
// import logoSrc from '../assets/images/cslogo.png';

const LandingPage = () => {
    const navigate = useNavigate();

    const handleStartClick = () => {
        navigate('/condition-setting');
    };

    const handleViewHistoryClick = () => {
        navigate('/growth-history'); // Navigate to the GrowthHistory page
    };

    // Placeholder links - replace # with actual paths
    const navLinks = [
        { name: 'New Simulation', href: '/condition-setting' },
        { name: 'Growth History', href: '/growth-history' },
        { name: 'City Sprouts', href: 'https://citysprouts.com.sg' },
        { name: 'Vidacity', href: 'https://vidacity.com.sg' },
    ];

    return (
        // Apply background and base flex settings here
        <div className="landing-page">
            {/* Navbar - Positioned at the top */}
            <div className="navbar">
                <div className="logo">
                    <img src="/src/assets/images/background.png" alt="City Sprouts Logo" style={{ height: '40px' }} /> {/* Added alt text and basic height */}
                </div>
                <nav className="nav-links">
                    {navLinks.map((link) => (
                        // Use anchor tags for external links, NavLink/Link from react-router-dom for internal routes if preferred
                        <a key={link.name}
                           href={link.href}
                           className="nav-link"
                           // Add target="_blank" for external links if needed
                           target={link.href.startsWith('http') ? '_blank' : '_self'}
                           rel={link.href.startsWith('http') ? 'noopener noreferrer' : ''}
                        >
                            {link.name}
                        </a>
                    ))}
                </nav>
            </div>

            {/* Main Content Wrapper - This will be centered */}
            <div className="landing-content-wrapper">
                <header className="landing-header">
                    {/* Ensure "Luckiest Guy" font is imported in CSS */}
                    <h1>Mushroom Growth</h1>
                </header>
                <main className="landing-content">
                    <button className="start-button" onClick={handleStartClick}>
                        Start Growing
                    </button>
                    <button className="view-history-button" onClick={handleViewHistoryClick}>
                        View History
                    </button>
                </main>
            </div>
             {/* Removed the large commented-out Tailwind block */}
        </div>
    );
};

export default LandingPage;
